create table flights
(
    flightNumber          varchar(20)    not null
        primary key,
    flightstart           varchar(50)    not null,
    flightend             varchar(50)    not null,
    flightTimeStart       time           not null,
    flightcheapMoney      decimal(10, 2) not null,
    cheaponeRemaining     int            not null,
    flightexpensiveMoney  decimal(10, 2) null,
    expensiveoneRemaining int            null,
    delayStatus           varchar(20)    null,
    flightTimeEnd         time           null
);

create table users
(
    account  varchar(50) not null
        primary key,
    password varchar(50) not null,
    nickname varchar(50) null,
    role     tinyint(1)  null
);

create table orderlist
(
    orderNumber    int         not null
        primary key,
    orderStatus    int         not null,
    account        varchar(50) null,
    flightNumber   varchar(20) null,
    passengerName  varchar(50) null,
    ExpensiveOrNot varchar(20) null,
    flightDate     date        not null,
    constraint orderlist_ibfk_1
        foreign key (account) references users (account),
    constraint orderlist_ibfk_2
        foreign key (flightNumber) references flights (flightNumber)
);

create index account
    on orderlist (account);

create index flight_number
    on orderlist (flightNumber);





